const room = {
    id: 1,
    roomId: 1,
    img: 'img',
    userId: 1,
    roomType: 'type',
    usageRate: 'high',
    start: '1-1-2000',
    end: '1-1-2000'
}
const user = {
    id: room.id,
    img: room.img,
    roomType: room.roomType,
    usageRate: room.usageRate
}
const admin = {
    id: room.id,
    roomId: room.roomId,
    userId: room.userId,
    start: room.start,
    end: room.end
}


export default{
    user, admin
}
